/*Wyœwietl tabliczkê mno¿enia w postaci tablicy.  
 * */
public class J48_tabl_mnozenia {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int[][] tabMno = new int[9][9];
		for(int i = 0; i < 9; i++){ 
			for(int j = 0; j < 9; j++){
					tabMno[i][j]=(i+1)*(j+1);
			System.out.print((tabMno[i][j]) +"\t"); 
			}
			System.out.println("");
		
		
		
		
		
		
		}
		
	}

}
